syntax = "proto3";
package proto;
import "Request.proto";
import "Response.proto";

option java_package = "com.iGap.proto";
option java_outer_classname = "ProtoChannelDelete";

message ChannelDelete {
    Request request = 1;
    uint64 room_id = 2;
}

message ChannelDeleteResponse {
    Response response = 1;
    uint64 room_id = 2;
}